import * as React from "react";
import Box from "@mui/material/Box";
import { Typography } from "@mui/material";

export default function Pages() {
  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "top",
        textAlign: "start",
        bgcolor: "black",
        borderRadius: 5,
        color: "white",
        justifyContent: "space-between",
        padding: "15px 15px 15px 15px",
        marginTop: "10px",
      }}
    >
      <Typography variant="h5">About Me</Typography>
      <Typography variant="body1">
      Hello!<br/>
        My name is João Victor Lerner Martins, and I'm a 20-year-old web developer based in Palhoça, Santa Catarina, Brazil. I've been immersed in the world of programming for the past year, passionate about creating innovative and efficient web solutions. Currently, I am enrolled in the Systems of Information program at Unisul, embarking on my first semester of studies. This academic journey complements my hands-on experience, allowing me to blend theoretical knowledge with practical skills in the dynamic field of web development. I am enthusiastic about learning and contributing to the ever-evolving landscape of technology.
      </Typography>
    </Box>
  );
}
